import React from 'react';

class Mediacard extends React.Component {
  render() {
    return (
      <li className='App-header'>
        <h1 className='App-user-name'>{this.props.name} </h1>
        <h3 className='App-date'>{this.props.date}</h3>
        <p className='App-paragraph'>{this.props.paragraph}</p>
      </li>
    );
  }
}

export default Mediacard;
